import styled from 'rn-css';

export const colors = {
    backgroundColor: '#f9f9f8',
    textColor: '#14171a',
    textColor2: '#777',
    defaultColor: '#FF6600',
    fadedOrange: '#FFE8C6',
    grey: '#C4C4C4',
    white: '#fff',
};

export const Text = styled.Text`
    font-family: Roboto-Regular;
    font-size: 15px;
    color: ${colors.textColor};
    line-height: 18px;
`;

export const TextBold = styled.Text`
    font-family: Roboto-Bold;
    font-size: 15px;
    color: ${colors.textColor};
`;
